import Login from './pages/Login.js';
import Main from './pages/Main.js';
import Signup from './pages/Signup.js';
import {Routes, Route, useNavigate, Link} from 'react-router-dom';

var CurrUser = null;
var Display = null;

function App() {
  console.log(CurrUser)

  const navigate = useNavigate();

  function GrantAccess(Username, Display) {
    CurrUser = Username
    Display = Display
    navigate('/')
  }

  return (
    <div>

      <Link to='/'>Home</Link>
      <Link to='signup'>Singup</Link>
      <Link to='/login'>Login</Link>

      <Routes>
        <Route path='/' exact element={<Main />} />
        <Route path='/signup' exact element={<Signup GrantAccess={GrantAccess}/>} />
        <Route path='/login' exact element={<Login GrantAcces={GrantAccess}/>} />
      </Routes>
    </div>
  );
}

export default App;
